    let randomCard = <Card key={randomObj.id} jargon={randomObj.jargon} definition={randomObj.definition} sentence={randomObj.sentence} image={randomObj.image} id={randomObj.id}/>
    return (
        <div>
            <h1>Welcome to the home of corporate jargon</h1>
            <div className='randomCard' >
            {/* {randomObj === undefined ? <p>Loading...</p> : randomCard} */}
            </div>
        </div>
    )
}

export default Home
